import React, { Component } from 'react';
import {Link } from 'react-router-dom';

class ProductPage extends Component {
    constructor()
    {
        super();
    }
    componentDidMount()
    {
        console.log('Product', 'componentDidMount')
    }

    componentDidUpdate()
    {
        console.log('Product', 'componentDidUpdate')
    }

    componentWillUnmount()
    {
        
        console.log('Product', 'componentWillUnmount')
    }
    render() {
        return (
            <div style={{backgroundColor:"lightgreen", width:"400px", height:"400px", textAlign:"Center"}}>
                <h2>Product Page</h2>
                    <Link to="/">Home Page</Link><br/>

                    ID:{this.props.match.params.id}<br/>
                    Name:{this.props.match.params.name}<br/>
                    Price:{this.props.match.params.price}<br/>

            </div>
        );
    }
}

export default ProductPage;
